import React from 'react';

const QuestionsDisplay = ({ questions }) => (
  <div>
    <h2>Generated Interview Questions</h2>
    {questions ? (
      <ul>
        {questions.map((question, index) => (
          <li key={index}>{question}</li>
        ))}
      </ul>
    ) : (
      <p>No questions available.</p>
    )}
  </div>
);

export default QuestionsDisplay;
